INSERT INTO laravel.blog_posts (title, isFeatured, tags, content, image)
VALUES (
    "Web 2.0 and Web 3.0", 
    false, 
    "#Blockchain, #Web2, #Web3", 
    "Web 2.0 and Web 3.0 are successive iterations of the web. Web 2.0 is the version that most people know and use today, which is the internet. The internet is where companies provide services to users in exchange for their data.\n\nWeb 2.0 developed the growth of user-generated content along with its compatibility and usability for users. Web 3.0 is built on the concept of decentralization which refers to a system where control is transferred from a central authority to a distributed network.\n\nIn Web 3.0, decentralized apps are run on the blockchain and the apps allow users to participate without giving up their data.", 
    'data:image/jpeg;base64,'
);

INSERT INTO laravel.blog_posts (title, isFeatured, tags, content, image)
VALUES (
    "Bitcoin? What is it?",
    false,
    "#Blockchain, #Cryptocurrency, #Bitcoin",
    "Bitcoin is the first ever successful cryptocurrency and payment system to ever exist and it was first launched in 2009 by creator Satoshi Nakamoto who is a presumed pseudonymous person.\n\nBitcoin is a virtual currency that is designed to act as a form of money and payment that removes the need of a middleman in financial transactions. It can be rewarded to blockchain miners for their work on verifying transactions and it can also be bought on several exchanges.",
    'data:image/jpeg;base64,'
);

INSERT INTO laravel.blog_posts (title, isFeatured, tags, content, image)
VALUES (
    "Crypto Wallet, More than an Address Book?",
    false,
    "#Blockchain, #Cryptocurrency, #Technology",
    "A crypto wallet is where users can keep their private keys and passwords to gain access to their cryptocurrencies.\n\nWallets can come in several forms such as Hardware wallets(ledger, usb stick), or mobile apps like coinbase. Crypto wallets are crucial to anyone that owns crypto currency.\n\nUnlike regular wallets, crypto wallets do not store your crypto, which is live on the blockchain; however it keeps your private keys that provide the proof of ownership that users have on the crypto.\n\nIf the users lose their private keys then they lose access to their crypto, so keep your wallet secure!",
    'data:image/jpeg;base64,'
);

INSERT INTO laravel.blog_posts (title, isFeatured, tags, content, image)
VALUES(
    "Tokens vs Coins, what's the difference?",
    true,
    '',
    "Cryptocurrency coins and tokens are both considered digital assets as they are both non tangible assets that are created and traded and stored in digital format.
    A cryptocurrency coin is a native currency on the blockchain, it is a medium of exchange and is also something that stores value.\n\nThis is used to purchase goods and services as well as something that could be used to exchange for something else like fiat currency. \n\nTokens are not so similar, they are digital assets but they don&apos;t have their own blockchain. They operate on the crypto coins blockchain like Ethereum; like Dai and Tether.\n\nAs coins rely on the blockchain itself, tokens need smart contracts which are arrays of code that expedite trades and payments of the users. Crypto tokens like cryptocurrency can also be used to hold value and be exchanged but they can also be used to represent physical assets , utility, services or even other digital assets. They are also used as a governance mechanism for voting on the upgrades and future decisions of specific protocols.\n\nCrypto coins and tokens are both digital assets; coins can be used to allow individuals to make payments with their own currency whereas tokens can be used for many other purposes.",
    'data:image/jpeg;base64,'
);

INSERT INTO laravel.blog_posts (title, isFeatured, tags, content, image)
VALUES(
    'What is the Blockchain?',
    false,
    '#Blockchain, #Cryptocurrency',
    "A blockchain is a system of transactions distributed across a network of computers. All blocks are connected to one another, and each block contains a number of transactions (a ledger).\n\nThe ultimate goal of a blockchain is to allow digital information to be recorded and distributed, but to remain immutable.\n\nThis remarkable technology has several applications in numerous industries including travel, healthcare, real estate and especially decentralized finance (DeFi).",
    "data:image/jpeg;base64,"
);